import React , { Component } from 'react';

class Header extends Component {
    render() {
        const headerStyle = {
            width : '100%' ,
            height: '50px' ,
            background : '#000000'
        }
        return(
            <div style={headerStyle}>
                tenine's blog
            </div>
        )
    }
}

export default Header;
